    <div>
      <div className="flex w-screen h-screen items-center">
        <motion.div
          drag="x"
          style={{ x, opacity }}
          className="text-center w-full text-4xl tracking-tight"
        >
          You know how music is often classified into{" "}
          <RoughNotation type="circle" show={true} animationDelay="1000">
            solid categories
          </RoughNotation>
          ?
        </motion.div>
      </div>
    </div>
  );
}

export default App;
